"use client";
import classNames from "classnames/bind";
import { useState } from "react";
import styles from "./Description.module.sass";
import Image from "next/image";

const PLACEHOLDER_IMAGE = `data:image/jpeg;base64,`;

export const Description = () => {
  const [hasBorder, setHasBorder] = useState(false);

  const handleClick = () => {
    setHasBorder(!hasBorder);
  };

  const context = classNames.bind(styles);

  const buttonStyles = context("Description__button", {
    "Description__button--border": hasBorder,
  });

  return (
    <section className={styles.Description}>
      <button onClick={handleClick} className={buttonStyles}>
        <div className={styles.Description__imageContainer}>
          <Image
            src="/images/imageCard.png"
            alt="Verifica tu cuenta paypal"
            // width={450}
            // height={450}
            fill
            placeholder="blur"
            blurDataURL={PLACEHOLDER_IMAGE}
          ></Image>
        </div>
      </button>

      <div className={styles.Description__text}>
        <h2>¡Verifica tu cuenta Paypal con Bsg!</h2>
        <p>
          Verifica tu cuenta paypal y comienza a recibir pagos de tus clientes
          en todo el mundo. ademas tendras beneficios como una mayor seguridad
          en tus transacciones, mayor confianza en tus clientes y mayor cantidad
          de clientes.
        </p>
      </div>
    </section>
  );
};
